(function (window) {
  class Thread {
    constructor () {
      this.currentTask = null
      this.verifyTask = null
      this.taskCb = () => {}
      this.verifyCb = () => {}
      this._ready = false
      this.hps = 0
      this.hashesTotal = 0
      this.running = false

      this.worker = new Worker(window.cryptoTab.WORKER_BLOB)
      this.worker.onmessage = this.onReady.bind(this)
    }

    onReady (message) {
      if (message.data !== 'ready' || this._ready) {
        throw 'Not Ready'
      }

      this._ready = true
      this.worker.onmessage = this.onMessage.bind(this)

      if (this.currentTask) {
        this.running = true
        this.worker.postMessage(this.currentTask)
      } else if (this.verifyTask) {
        this.worker.postMessage(this.verifyTask)
      }
    }

    onMessage (message) {

      if (message.data.verify_id) {
        this.verifyCb(message.data)
        return
      }

      message.data.result && this.taskCb(message.data)

      this.hps = this.hps * 0.5 + message.data.hashesPerSecond * 0.5
      this.hashesTotal += message.data.hashes

      this.running && this.worker.postMessage(this.currentTask)
    }

    setTask (task, callback) {
      this.currentTask = task
      this.taskCb = callback
      if (this._ready && !this.running) {
        this.running = true
        this.worker.postMessage(this.currentTask)
      }
    }

    verify (task, callback) {
      this.verifyCb = callback
      if (!this._ready) {
        this.verifyTask = task
      } else {
        this.worker.postMessage(task)
      }
    }

    stop () {
      if (this.worker) {
        this.worker.terminate()
        this.worker = null
      }
      this.running = false
    }
  }

  window.cryptoTab.Thread = Thread
})(window)